import React from "react";
import Box from "@mui/material/Box";

const UserBadgeItem = ({ user, handleFunction }) => {
  return (
    <Box style={{ cursor: "pointer" }} onClick={handleFunction}>
      {user.name}
      <img
        src="./Images/CloseIcon.png"
        alt="Close Icon"
        className="closeIcon"
      />
    </Box>
  );
};

export default UserBadgeItem;
